async function play() {
	var frames = n.length;
	for (var i = 0; i < frames; i++) {
	    document.getElementById("output").innerHTML = "<font color=\"" + colour + "\"><pre>" + n[i] + "</font></pre>";
	    await new Promise(r => setTimeout(r, 29));
	}
	play();
}
